script: |
  super -f text -I q599.spq | sort > q599.out

inputs:
  - name: q599.spq
    data: |
      SELECT + col2 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col1 - + col2 + + ( + 31 ) + ( - col2 ) * + - ( + CAST ( NULL AS INTEGER ) ) + - - 18 / + col0 BETWEEN ( + - col2 * - - 43 ) AND - col0;
  - name: tab0

outputs:
  - name: q599.out
    data: |
